import { Link } from "react-router-dom"

const Menu = () => {
  return (
    <nav>
      <Link to=".">Home</Link>
      <Link to="/about">About</Link>
      <Link to="/contacts">Contacts</Link>
    </nav>
  )
}

export default Menu
